import React, { useState } from "react";
import "./App.css";

const App = () => {
  const [configuration, setConfiguration] = useState({
    totalTickets: "",
    ticketReleaseRate: "",
    customerRetrievalRate: "",
    maxTicketCapacity: "",
  });

  const [savedConfig, setSavedConfig] = useState(null);
  const [ticketDetails, setTicketDetails] = useState({
    totalTickets: 0,
    maxTickets: 0,
    soldTickets: 0,
    remainingTickets: 0,
  });

  const [systemStatus, setSystemStatus] = useState("Stopped");

  // Backend base URL
  const BASE_URL = "http://localhost:5001"; // Ensure this is correct

  // Handle input changes in configuration form
  const handleChange = (e) => {
    const { name, value } = e.target;

    // Validate only positive integers
    if (value === "" || /^\d+$/.test(value)) {
      setConfiguration({ ...configuration, [name]: value });
    } else {
      alert("Please enter a valid positive number.");
    }
  };

  // Handle configuration submission
  const handleConfigure = async () => {
    const totalTickets = parseInt(configuration.totalTickets, 10);
    const ticketReleaseRate = parseInt(configuration.ticketReleaseRate, 10);
    const customerRetrievalRate = parseInt(configuration.customerRetrievalRate, 10);
    const maxTicketCapacity = parseInt(configuration.maxTicketCapacity, 10);

    if (!totalTickets || !ticketReleaseRate || !customerRetrievalRate || !maxTicketCapacity) {
      alert("Please fill all fields!");
      return;
    }

    if (maxTicketCapacity <= 0 || maxTicketCapacity > totalTickets) {
      alert("Max Ticket Capacity must be greater than 0 and less than or equal to Total Tickets.");
      return;
    }

    try {
      const response = await fetch(`${BASE_URL}/api/configure`, {
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        body: JSON.stringify({
          totalTickets,
          ticketReleaseRate,
          customerRetrievalRate,
          maxTicketCapacity,
        }),
      });

      const result = await response.json();

      if (response.ok) {
        setSavedConfig(configuration);
        setTicketDetails({
          totalTickets,
          maxTickets: maxTicketCapacity,
          soldTickets: 0,
          remainingTickets: totalTickets,
        });
        setSystemStatus("Stopped");
        alert(result.message);
      } else {
        alert(result.message);
      }
    } catch (error) {
      console.error("Error configuring system:", error);
      alert("Failed to configure the system. Please try again.");
    }
  };

  // Handle system start
  const handleStart = async () => {
    if (!savedConfig) {
      alert("Please configure the system first!");
      return;
    }

    try {
      const response = await fetch(`${BASE_URL}/api/start`, {
        method: "POST",
      });

      const result = await response.json();

      if (response.ok) {
        setSystemStatus("Running");
        alert(result.message);
      } else {
        alert(result.message);
      }
    } catch (error) {
      console.error("Error starting system:", error);
      alert("Failed to start the system. Please try again.");
    }
  };

  // Handle system stop
  const handleStop = async () => {
    try {
      const response = await fetch(`${BASE_URL}/api/stop`, {
        method: "POST",
      });

      const result = await response.json();

      if (response.ok) {
        setSystemStatus("Stopped");
        alert(result.message);
      } else {
        alert(result.message);
      }
    } catch (error) {
      console.error("Error stopping system:", error);
      alert("Failed to stop the system. Please try again.");
    }
  };

  // Handle reset function
  const handleReset = () => {
    setConfiguration({
      totalTickets: "",
      ticketReleaseRate: "",
      customerRetrievalRate: "",
      maxTicketCapacity: "",
    });
    setSavedConfig(null);
    setTicketDetails({
      totalTickets: 0,
      maxTickets: 0,
      soldTickets: 0,
      remainingTickets: 0,
    });
    setSystemStatus("Stopped");
  };

  return (
    <div className="App">
      <h1>Ticketing System</h1>

      <h2>Configure System</h2>
      <div>
        <label>Total Tickets:</label>
        <input
          type="text"
          name="totalTickets"
          value={configuration.totalTickets}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Ticket Release Rate:</label>
        <input
          type="text"
          name="ticketReleaseRate"
          value={configuration.ticketReleaseRate}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Customer Retrieval Rate:</label>
        <input
          type="text"
          name="customerRetrievalRate"
          value={configuration.customerRetrievalRate}
          onChange={handleChange}
        />
      </div>
      <div>
        <label>Max Ticket Capacity:</label>
        <input
          type="text"
          name="maxTicketCapacity"
          value={configuration.maxTicketCapacity}
          onChange={handleChange}
        />
      </div>

      <button onClick={handleConfigure}>Configure</button>
      <button onClick={handleReset}>Reset</button>

      <h2>System Status</h2>
      <div>Status: {systemStatus}</div>
      <div>Total Tickets: {ticketDetails.totalTickets}</div>
      <div>Max Capacity: {ticketDetails.maxTickets}</div>
      <div>Tickets Sold: {ticketDetails.soldTickets}</div>
      <div>Remaining Tickets: {ticketDetails.remainingTickets}</div>

      <button onClick={handleStart}>Start</button>
      <button onClick={handleStop}>Stop</button>
    </div>
  );
};

export default App;
